【フィジシャンズフォーミュラ アイライナー&セラム Ultra Black ELS01の詳細】<br>
●無香料・パラベンフリーの低刺激性。<br>
●美容液配合の描きやすい筆タイプのアイライナー。<br><br>

【使用方法】<br>
筆の先を細く整え、まつげの隙間を埋めるようにラインを描きます。<br><br>

【ご注意】<br>
○お肌に異常が生じていないか注意して使用してください。<br>
○お肌に合わないときは、ご使用をおやめください。<br><br>

【成分】<br>
水、(アクリル酸エチルヘキシル/メタクリル酸メチル)コポリマー、BG、ベヘネス-30、グリセリン、(アクリレーツ/メチルスチレン/スチレン)コポリマーアンモニウム、変性アルコール、フェノキシエタノール、ミリストイルペンタペプチド-17、1.2-ヘキサンジオール、カプリリルグリコール、(アクリレーツ/オクチルアクリルアミド)コポリマー、ペンチレングリコール、エチルヘキシルグリセリン、ポリグリセリル-3ジシロキサンジメチコン、水酸化Na、EDTA-2Na、安息香酸、安息香酸Na、カーボンブラック<br><br>

【内容量】<br>
0.5ml<br><br>

【販売元】<br>
株式会社ビーアンドエフ<br>
東京都港区六本木7-15-10<br>
お電話：0120-386-333<br><br>

【商品区分】<br>
化粧品<br><br>

[Physicians Formula アイライナー]

<br><br><br><hr>
広告文責：株式会社モリキ<br>
電話：0269-38-0611<br><style type="text/css">
